uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_scale;
uniform float u_glow;
uniform float u_hue;   // Near Color
uniform float u_hue2;  // Far Color

out vec4 fragColor;

// --- Helper Functions ---

vec3 hsb2rgb(vec3 c) {
    vec3 rgb = clamp(abs(mod(c.x * 6.0 + vec3(0.0, 4.0, 2.0), 6.0) - 3.0) - 1.0, 0.0, 1.0);
    rgb = rgb * rgb * (3.0 - 2.0 * rgb);
    return c.z * mix(vec3(1.0), rgb, c.y);
}

// Pastel Palette Logic
vec3 getPastelColor(float hue, float z) {
    // Soft saturation (0.4 fading to 0.2)
    // High brightness (1.0 fading to 0.6)
    float sat = mix(0.4, 0.2, z); 
    float bri = mix(1.0, 0.6, z); 
    return hsb2rgb(vec3(hue, sat, bri));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 uv0 = uv;

    // Params
    float spd = (u_speed <= 0.0) ? 0.3 : u_speed;
    float time = iTime * spd;
    float scale = (u_scale <= 0.0) ? 1.0 : u_scale;
    float glowInt = (u_glow <= 0.0) ? 1.5 : u_glow;

    // Manual Hues (Default to Cyan -> Purple if 0.0)
    float hueNear = (u_hue == 0.0) ? 0.5 : u_hue;
    float hueFar = (u_hue2 == 0.0) ? 0.8 : u_hue2;

    // Background: Deep Dark Violet
    vec3 finalColor = vec3(0.02, 0.01, 0.05);

    // Layers
    const int LAYERS = 60; 
    float camHeight = 0.0; 

    for(int i = LAYERS; i > 0; i--) {

        // Perspective Z
        float zIndex = float(i) - fract(time * 1.5); 
        float z = zIndex * 0.15; // Dense spacing

        if(z < 0.1) continue; 

        float projection = 1.0 / z;
        float waveX = uv.x * z * 4.0; 

        // --- SAFE TUNNEL LOGIC ---

        // 1. Center Spine
        float spineY = sin(waveX + time + z) * 0.2 * scale;
        spineY += sin(waveX * 0.5 - time * 1.2) * 0.1 * scale;

        // 2. Tunnel Radius (Open wide)
        float radius = 0.5 + 0.15 * sin(z * 3.0 - time * 2.0 + waveX);
        radius *= scale;

        // 3. Screen Projection
        float screenSpine = (spineY - camHeight) * projection * 0.4;
        float screenRadius = radius * projection * 0.4;

        float screenFloor = screenSpine - screenRadius;
        float screenCeil = screenSpine + screenRadius;

        // --- Visuals ---

        float distFloor = abs(uv.y - screenFloor);
        float distCeil = abs(uv.y - screenCeil);
        float dist = min(distFloor, distCeil);

        float thickness = 0.007 * projection; 

        // Glow
        float lineGlow = exp(-dist / thickness) * (glowInt * 0.8);

        // Fog
        float fog = smoothstep(0.0, 0.65, projection); 

        // --- Color Mixing ---
        // Mix between Hue1 and Hue2 based on depth (z)
        // clamp(z * ...) adjusts where the gradient transition happens
        float currentHue = mix(hueNear, hueFar, clamp(z * 0.2, 0.0, 1.0));

        vec3 col = getPastelColor(currentHue, clamp(z * 0.08, 0.0, 1.0));

        // --- Composition ---

        // 1. Line Glow
        finalColor += col * lineGlow * fog;

        // 2. Fill Logic
        float isBelow = smoothstep(0.0, thickness * 2.5, screenFloor - uv.y); 
        float isAbove = smoothstep(0.0, thickness * 2.5, uv.y - screenCeil); 
        float fillMask = max(isBelow, isAbove);

        // Low Opacity Fill
        finalColor += col * fillMask * 0.015 * fog * projection;
    }

    // Horizon Glow (Matches Far Color)
    vec3 horizonCol = hsb2rgb(vec3(hueFar, 0.4, 0.6)); 
    float horizonGlow = exp(-abs(uv0.y) * 8.0);
    finalColor += horizonCol * horizonGlow * 0.3; 

    // Post-Processing
    finalColor *= 1.2 - length(uv0) * 0.6; 
    finalColor = clamp(finalColor, 0.0, 1.0);
    finalColor = pow(finalColor, vec3(0.9)); 

    fragColor = vec4(finalColor, 1.0);
}

